import ChickensForm from './ChickensForm';
import classes from './ChickensItem.module.css';

const ChickensItem = props => {
    const price  = `$${props.chicken.price.toFixed(2)}`;
    return (
        <li className={classes.meal}>
            <div>
                <div><h3>{props.chicken.name}</h3></div>
                <div className={classes.description}>{props.chicken.description}</div>
                <div className={classes.price}>{price}</div>
            </div>
            <div>

            </div>
        </li>
    );
};

export default ChickensItem;
